import React from 'react';
import logo from './logo.svg';
import Topbar from './Components/Topbar';
import './App.css';

import imgMB from './Images/MichaelBurry.jpg';
import imgWB from './Images/Warren_Buffett.jpg';
import imgKG from './Images/Ken_Griffin.jpg';

function App() {
  return (
    <div >
      <Topbar />
      <div>
      <img src = {imgMB} />
      </div>
      <div>
      <img src = {imgWB} />
      </div>
      <div>
      <img src = {imgKG} />
      </div>
/>    </div>
  );
}

export default App;
